import '../../App.css';
import CrimeComparison from '../CrimeComparison';
import AverageCrimeTrend from '../AverageCrimeTrend';

function CrimeCategorization() {
    return (
        <div className="PageContainer">
            <CrimeComparison />
            <AverageCrimeTrend />
        </div>
    );
}

export default CrimeCategorization;
